import React, { useContext } from 'react'
import './CSS/MarketplaceCategory.css'
import { ShopContext } from '../Context-api/ShopContext'
import ArrowDropDownLineIcon from 'remixicon-react/ArrowDropDownLineIcon'
import { Item } from '../Components/Item/Item'

export const MarketPlaceCategory = (props) => {
  const { all_product } = useContext(ShopContext);

  return (
    <div className='marketplace-category'>
      <img src={props.banner} className='marketplacebanner' alt='' />
      <div className='MarketPlaceCategory-indexsort'>
        <p>
          <span>Showing 1-12</span> out of 56 products
        </p>
        <div className="marketplacecategory-sort">
          sort by <ArrowDropDownLineIcon className='dropdown-icon' />
        </div>
      </div>
      <div className="MarketPlaceCategory-products">
        {all_product.map((item, i) => {
          if (props.Category === item.Category) {
            return (
              <div key={i} className="otherDiv">
                <Item
                  id={item.id}
                  name={item.name}
                  image={item.image}
                  new_price={item.new_price}
                  old_price={item.old_price}
                />
              </div>
            );
          } else {
            return null; // Do not render the item here
          }
        })}
      </div>
      {/* Start of the slide section */}
      <section id='tranding'>
        <div className="container">
          <h3 className='text-center section-subheading'>- popular Delivery -</h3>
        </div>
        <div className="container">
          <div className="swiper tranding-slider">
            <div className="swiper-wrapper">
              {/* Render items in the slider */}
              {all_product.map((item, i) => (
                <div key={i} className="swiper-slide tranding-slide">
                  <div className="tranding-slide-img">
                    <Item
                      id={47}
                      name="Football planet exploding"
                      image={item.image} // Assuming img_47 is imported or set to the correct URL
                      new_price={1500.00}
                      old_price={2800.00}
                    />
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>
      {/* End of the slide section */}
      <div className="MarketPlaceCategory-loadmore">
        Explore More
      </div>
    </div>
  );
};
